import react from "react";
import Sample from "../Assets/Sample.jpg";


function ProjectCard(props) {
    const { Title, excerpt, imageUrl } = props;
    return(
        <div>
            <div className="card shadow h-100">
                        <img className="card-img-top" src={Sample} alt="project photo"/>
                        <div className="card-body"> 
                            <h4> Project {TitleNumber}
                                <a href="form.html" className="text-dark stretched-link" > ...</a>
                            </h4>
                            <p>{excerpt} This is one of my project.</p>
                        </div>
                    </div>
        </div>
    );
}

export default ProjectCard;
